function ExcelDateToJSDate(serial)
{
    var utc_days = Math.floor(serial - 25569);
    var utc_value = utc_days * 86400;
    var date_info = new Date(utc_value * 1000);

    var fractional_day = serial - Math.floor(serial) + 0.0000001;

    var total_seconds = Math.floor(86400 * fractional_day);

    var seconds = total_seconds % 60;

    total_seconds -= seconds;

    var hours = Math.floor(total_seconds / (60 * 60));
    var minutes = Math.floor(total_seconds / 60) % 60;

    let date = new Date(date_info.getFullYear(), date_info.getMonth(), date_info.getDate(), hours, minutes, seconds);
    date.setHours(date.getHours() + 7);
    return date.toISOString().split('T')[0];
}

function extractDateInfo(data) {
    const dateRegex = /WK(\d{2}) - .*?\((\d{2})\.(\d{2})\.(\d{4})\)/;
    const match = data.match(dateRegex);
    if (match) {
        const [, workweek, day, month, year] = match;
        const d_date = {
            workweek: workweek,
            date: day,
            month: month,
            year: year
        };
        return d_date;
    } else {
        return null;
    }
}


function _escapeString(data) {
    if (data !== undefined && data !== null) {
        data = data.replace(/[\0\n\r\b\t\\'"\x1a]/g, function (s) {
            switch (s) {
                case "\0":
                    return "\\0";
                case "\n":
                    return "\\n";
                case "\r":
                    return "\\r";
                case "\b":
                    return "\\b";
                case "\t":
                    return "\\t";
                case "\x1a":
                    return "\\Z";
                case "'":
                    return "''";
                case '"':
                    return '""';
                default:
                    return "\\" + s;
            }
        });
    } else {
        data = null;
    }
    return data;
};

function ResultData(data, mode) {
    let defaultType;
    let stringData = data;
    if (mode === 0) {
        defaultType = 0;
        stringData = parseFloat(data);
    } else if (mode === '0') {
        defaultType = `'0'`;
        if (isNaN(data)) {
            stringData = `'${_escapeString(data)}'`;
        } else {
            stringData = `'${data}'`;
        }
    }
    else if (mode === '') {
        defaultType = `''`;
    }
    else {
        defaultType = null;
        if (isNaN(data)) {
            stringData = `'${_escapeString(data)}'`;
        } else {
            stringData = `'${data}'`;
        }
    }
    return data !== undefined && data !== null ? stringData : defaultType;
}


